import "../styles/About.css";
import about from "../assets/about.jpeg"

function About() {
  return (
    <div id="about-wrapper">
      <div className="about">
        <div className="about-text">
          <h3>About.</h3>
          <p>Hey, I'm Sheakin—on a mission to master the world of Python development.
As a Full Stack Developer with expertise in Python, Django, and React, I bring hands-on experience gained through meaningful internships and projects. I’ve developed and deployed dynamic web applications, including a full-featured e-commerce platform with comprehensive user functionalities, seamless payment integration, and efficient cart management. Leveraging advanced tools and frameworks, I consistently contribute to team projects, delivering high-quality, user-centric solutions.

I’m driven by a commitment to collaboration and continuous learning. Engaging with the tech community keeps me inspired and motivated to explore new horizons. Whether I’m at a hackathon, contributing to open-source, or attending AI meetups, I find immense value in sharing ideas and experiences with like-minded individuals.

Outside the code, I embrace life’s many facets, blending my passion for technology with a love for football, music, and storytelling. For me, it’s about striking the perfect harmony between code and culture, making every day an exciting adventure.</p>
          <a href="#" className="readmore">Read more..</a>
        </div>
        <div className="about-img">
          <img src={about}/>
        </div>
      </div>
    </div>
  );
}

export default About;
